import React from 'react';
import '../css/aside.css';

export default function Aside () {
    return (
        <div>
        <table>
            <tr>
                <td className="purple_aside"></td>
                <td>
                    <div className="purple_menu"></div>
                </td>
            </tr>
        </table>

    </div>
    );
}
